import React from 'react';
import {startTimes} from '../times';


function Dropdown(props) {
  let options = startTimes

  return (
    <>
      <label>
        {props.label}
        <select value={props.value} onChange={props.change}>
        {options.map((option) => (
          <option key={option.id} value={option.id}>{option.time}</option>
        ))}
      </select>
    </label>

    </>
  )
}

export default Dropdown;
